window.bookSummaryJSON = "<p><b>A man with a mysterious past must find a missing teenage girl in this shocking thriller from the number one </b><b><i>New York Times</i></b><b> best-selling author of </b><b><i>Run Away</i></b><b>. </b></p> <p>Thirty years ago, Wilde was found as a boy living feral in the woods, with no memory of his past. Now an adult, he still doesn't know where he comes from, and another child has gone missing.</p> <p>No one seems to take Naomi Pine's disappearance seriously, not even her father - with one exception. Hester Crimstein, a television criminal attorney, knows through her grandson that Naomi was relentlessly bullied at school. Hester asks Wilde - with whom she shares a tragic connection - to use his unique skills to help find Naomi.</p> <p>Wilde can't ignore an outcast in trouble, but in order to find Naomi he must venture back into the community where he has never fit in, a place where the powerful are protected even when they harbor secrets that could destroy the lives of millions...secrets that Wilde must uncover before it's too late.</p>"; 
